的人机交互、操作逻辑、界面美观的整体设计。好的UI设计不仅是让软件变得有个性有品味，还要让软件的操作变得舒适、简单、自由、充分体现软件的定位和特点。——from 度娘\n\nUI设计不仅仅是设计，是针对user的设计，越是简洁的设计即代表了越是简洁的操作，越是简洁的操作即代表越是更好的用户体验，这种效果在APP里更为明显——帮助用户减少对许多功能操作的学习，或者操作上更加原始直观。\n', '2013-04-07 22:20:15', '292', '1', '1'), ('730', '515e6947790b0', '（¯﹃¯） ', '2013-04-07 22:20:41', '325', '0', '1'), ('731', '51617ff120ca5', '0、0', '2013-04-07 22:22:04', '292', '1', '1'), ('732', '51604110cfed9', '还有，你回答了我的问题，我要再次回复你的时候是直接显示在我的下面在而且消息提示也是我的问题被回复了·······并没有@huip什么的···', '2013-04-07 22:22:53', '274', '0', '1'), ('733', '51604110cfed9', '还有有木有截图上传提问的功能？····', '2013-04-07 22:24:34', '274', '0', '1'), ('734', '515e6947790b0', '转载 纯属交流\n\nupan.us 提取码  m10W\n\n一、整个简历采用半封闭式线条，线条有引导视线的功能，意在让HR顺着线条看我的简历。\n\n二、删繁就简。\n很多简历喜欢把自己的实习时间写上去，纯属浪费面积。\n\n\n三、字体的选择。我试了上百种字体，最终发现，微软雅黑看起来非常舒适。但整篇都用统一字体未免给人层次不分明之感，所以用两种字体，每种字体字号亦不同，条理清晰，分明。\n\n四、数字说话。很多假大空的字很没效果，又不是毛概。这里面我总结了如下原则。\n\n1、限定在某个时间段。如在一周内取得了XX成绩。\n2、递进。如第一期XX，第二期XXX，层层增加，给人以上升之感。\n3、适当的修饰。比如某些业务的数字，不要用利润，而要用收入，这样数字一下多个0，看起来是不很NB~再比如我没有写我读了多少本书，而用读了多少万字，看起来也很有视觉冲击力。\n\n五、展现的你的逻辑。\n如本人简历的最后一块。\n\n采用FABE法构思，特征=》优势=》利益，之后上面都为证据。比写我逻辑很强巴拉巴拉之类的文字效果好很多。\n\n六、配色，彩蛋。\n\n打印效果非常好，颜色柔而不伤眼，最后的八个小人有一个加黑，寓意着与众不同的我。\n\nP.S. 这份简历前后修改近50次，还分多个版本（对应不同企业)，而且是PS制作，每改一次我蛋碎一次，想做好简历，先拿出毅力。\n再P.S.我的简历学生会工作和奖学金均为扯淡。为应付国企。\n========================================================================\n再谈谈简历对求职的作用。 绝对是锦上添花，而非雪中送炭。\n\n很多企业是有硬指标的，你懂得。\n比如某些银行，地产要六寸彩色生活照（我个大老爷们没事不爱拍照），没有直接OUT。\n再比如某些企业对学校学位有要求，我在这里想黑一下统一（NND我有多年快消经验，加上宣讲会上精彩提问），因为我不是硕士直接被刷。\n遇上这些，很无奈的。\n\n而且，很多企业现在选择网上投递简历，意味着你可以编造一些，奖学金，排名，干部之类你随便编，而你自己做的简历，是面试的时候才派上用场。\n\n那么，都到面试了，如果你不行，你觉得一份简历能救得了你么？\n\n如果还有时间，建议多增加自己的历练，这才是王道。\n如果时间急迫，用心做一份简历，把做简历的过程，当做一次历练，也算是你的干货了。\n\n========================================================================\n看到大家有些补充，在此解释一下，感谢大家啦~\n\n关于求职意向：会针对不同企业进行修改，这是版通用的，故没有写，而实际操作中，往往是面试才会用到自制简历，所以写不写问题不大，还占空间。\n\n关于邮箱：有人喜欢用GMAIL，结果就是各种收不到企业邮件通知..\n这份简历最初是去聘腾讯的，所以..\n\n关于一些证书：PS个证书毫无压力，关键是要表现出你有匹配这个证书的实力。', '2013-04-07 22:26:15', '289', '0', '1'), ('735', '