0b0', '好像是必须的，好像是很多信息都整合到这个上面去，成绩  课程  学分  etc\n不完善可能很多通知都不会收到。我们班的几个人填写不合格都被打回来重新填的。', '2013-04-15 13:26:01', '470', '1', '1'), ('1262', '515e6947790b0', '加油', '2013-04-15 13:27:01', '469', '1', '1'), ('1263', '5167d9df854a4', '黑幕啊，绝对的黑幕啊！', '2013-04-15 16:55:11', '473', '0', '1'), ('1264', '515bccf8c3749', '我只能说是高端黑，然后就是羽泉请了个好帮手邓超，还有就是他们唱的很嗨，很欢快。。。', '2013-04-15 16:55:11', '473', '0', '1'), ('1265', '51615f98e5068', '快餐店不是改成学子餐厅了吗？热干面挺好吃的', '2013-04-15 17:01:57', '472', '0', '1'), ('1266', '515bccf8c3749', '你说的是哪个快餐厅啊？？？', '2013-04-15 17:02:21', '472', '0', '1'), ('1267', '515bccf8c3749', '北苑应该有吧。。。', '2013-04-15 17:03:44', '471', '1', '1'), ('1268', '515eab4c6c726', '必须先有我啊.', '2013-04-15 17:08:29', '294', '0', '1'), ('1269', '515bccf8c3749', '为什么男生找不到女朋友呢？？？', '2013-04-15 18:14:27', '475', '0', '1'), ('1270', '5163fc4ad78b5', '我吃过~很好吃~', '2013-04-15 18:26:02', '472', '0', '1'), ('1271', '51616f2c6f8d8', '貌似两者不冲突吧~', '2013-04-15 18:44:03', '475', '0', '1'), ('1272', '51616f2c6f8d8', '炒菜感觉不是特别好吃，一楼的打菜还可以，不过吃了一年了~腻了', '2013-04-15 18:45:05', '472', '0', '1'), ('1273', '516bdfd5563ea', '等到冬天来就好了', '2013-04-15 19:16:31', '476', '0', '1'), ('1274', '515e6c521a23d', '空气都是热的', '2013-04-15 20:56:32', '476', '0', '1'), ('1275', '515e6c521a23d', '因为可以一人男生基本都有了啊。那也很多嘛', '2013-04-15 20:58:25', '475', '0', '1'), ('1276', '515e6c521a23d', '你是歌手', '2013-04-15 20:59:40', '473', '0', '1'), ('1277', '515e6c521a23d', '。。我觉得羽泉是很不错啊。。。虽然我也很喜欢林志炫', '2013-04-15 21:00:07', '473', '0', '1'), ('1278', '515e6c521a23d', '我，觉得还挺好，但都不能多吃。吃多就腻', '2013-04-15 21:00:59', '472', '0', '1'), ('1279', '51676d1d49db8', '不会去了 上次去也觉得就那样吧 还是去其他地方看看', '2013-04-15 22:01:51', '477', '0', '0'), ('1280', '515bccf8c3749', '你要采访那方面的啊，你是什么组织的啊？？？', '2013-04-15 22:32:52', '478', '0', '1'), ('1281', '515bccf8c3749', '我家离凤凰不远，不知道我要不要门票？？？', '2013-04-15 22:34:24', '477', '0', '0'), ('1282', '51615f98e5068', '不去', '2013-04-15 22:36:32', '477', '1', '0'), ('1283', '515bccf8c3749', '躲在房子里面不出来，不就行了。。。', '2013-04-15 22:39:33', '476', '0', '1'), ('1284', '5163f62f38368', '这个要是放假可以到当地教育局问,目前的可以到资助中心问吧.....,或者问下辅导员', '2013-04-16 08:37:28', '481', '0', '1'), ('1285', '5163f62f38368', '据我所了解及一些也是大四的老乡和some学工部的介绍，步骤如下咯：\n1.毕业生与用人单位“双向选择”\n2.毕业生与用人单位达成录取意向，并签订就业协议\n3.就业协议书交所在院(系)鉴证\n4.协议书交校就业指导服务中心签章登记\n5.列入就业方案（5月10日前）\n6.上报就业方案（6月10日前）\n。。其实也不是那么麻烦的，呵呵', '2013-04-16 09:02:24', '482', '0', '1'), ('1286', '516c9f95eeca0', '好像普通话考试刚过了吧，普通话得过二级乙等以上，报考教师资格证得先报考省教育学，心理学考试（一般为3月，9月底进行）并取得合格证书，其次再去教育学能力测试，最后就等认定机构发证啦(^_^)。', '2013-04-16 09:14:55', '486', '0', '1'), ('1287', '5163f62f38368', '就我们计科院说吧，四级报考资格是期末75分以上啊。', '2013-04-16 09:25:28', '483', '0', '0'), ('1288', '516c9f95eeca0', '这个把它经济化了，就不唯一了，有何区别', '2013-04-16 09:28:19', '477', '0', '0'), ('1289', '516c9957b8af3', '你好！我来回答你的问题吧。\n\n申请校园网流程\n\n校园网的使用对象（即充值卡的购买对象）\n根据学校相关规定，校园网的使用对象要是我们民大符合条件的在籍本科学生和研究生（为了保证基础课程的学习，对于大一和预科学生不开通接入校园网）。\n \n2、校园网的办理流程\n(1)获取IP地址、购买校园网充值卡（两者不分先后）。\n(2)在个人电脑上正确设置IP地址。\n(3)打开上网页面（http://172.16.0.2），按要求填写上网账号（学号）和上网密码（默认为8888），进入充值页面。\n(4）在“卡充值”模块下输入充值卡的卡号和密码完成充值。\n \n3、校园网IP地址的分配时间\n一般情况，学校校园网IP地址分配会集中办理一次，时间为9月17、18、19日三天，地点在大活三楼。我们学生凭本人学号和宿舍号获取IP，IP一旦确定，在校期间将固定不变。\n如果因为一些事情比较忙的话，错过本次IP集中分配的时间，那么可在其它正常上班时间到网络技术中心（4号楼5楼）领取。\n \n4、充值卡的购买地点、时间和使用范围\n校园网的充值卡购买地点及时间：南区超市（4栋宿舍旁），开始售卖时间为2012年9月17日；使用范围：南区学生宿舍所有楼栋；但是对于北区的同学要注意了，因为北区的校园网没有全部覆盖，所以北区学生公寓只有6A、6B、7A、7B、8A、8B等6栋才可以使用校园网。\n \n5、充值卡充值金额及资费说明\n校园网充值卡金额共分为20元和80元两种，其中购买80元充值卡额外附送20元上网费用，这个算起来挺优惠的，我本人就是购买这一种的；另一种就是只有一个月的，20元的。 \n6、校园网有关咨询\n当然，如果在使用校园网时遇到一些问题的话，就可以到网络技术中心(4号楼5楼)或者拨打电话027-67843672进行相关咨询。\n \n温馨提示：\n1、新的上网收费方式实施后，大学生活动中心三楼今后将不再受理校园网办理及咨询相关事宜。\n2、大一新生及预科学生请不要购买校园网充值卡，以免造成不必要的损失。\n3、新学期校网络中心为提高同学们的上网使用感受，开通了高清电影，电视点播系统，具体使用方法请登录http://59.68.63.19。\n\n最后，希望我的回答对你提出的问题有帮助。。。', '2013-04-16 09:52:08', '480', '2', '0'), ('1290', '516c96d784c50', '你好！我来回答你的问题吧。\n\n申请校园网流程\n\n校园网的使用对象（即充值卡的购买对象）\n根据学校相关规定，校园网的使用对象要是我们民大符合条件的在籍本科学生和研究生（为了保证基础课程的学习，对于大一和预科学生不开通接入校园网）。\n\n2、校园网的办理流程\n(1)获取IP地址、购买校园网充值卡（两者不分先后）。\n(2)在个人电脑上正确设置IP地址。\n(3)打开上网页面（http://172.16.0.2），按要求填写上网账号（学号）和上网密码（默认为8888），进入充值页面。\n(4）在“卡充值”模块下输入充值卡的卡号和密码完成充值。\n\n3、校园网IP地址的分配时间\n一般情况，学校校园网IP地址分配会集中办理一次，时间为9月17、18、19日三天，地点在大活三楼。我们学生凭本人学号和宿舍号获取IP，IP一旦确定，在校期间将固定不变。\n如果因为一些事情比较忙的话，错过本次IP集中分配的时间，那么可在其它正常上班时间到网络技术中心（4号楼5楼）领取。\n\n4、充值卡的购买地点、时间和使用范围\n校园网的充值卡购买地点及时间：南区超市（4栋宿舍旁），开始售卖时间为2012年9月17日；使用范围：南区学生宿舍所有楼栋；但是对于北区的同学要注意了，因为北区的校园网没有全部覆盖，所以北区学生公寓只有6A、6B、7A、7B、8A、8B等6栋才可以使用校园网。\n\n5、充值卡充值金额及资费说明\n校园网充值卡金额共分为20元和80元两种，其中购买80元充值卡额外附送20元上网费用，这个算起来挺优惠的，我本人就是购买这一种的；另一种就是只有一个月的，20元的。 \n6、校园网有关咨询\n当然，如果在使用校园网时遇到一些问题的话，就可以到网络技术中心(4号楼5楼)或者拨打电话027-67843672进行相关咨询。\n\n温馨提示：\n1、新的上网收费方式实施后，大学生活动中心三楼今后将不再受理校园网办理及咨询相关事宜。\n2、大一新生及预科学生请不要购买校园网充值卡，以免造成不必要的损失。\n3、新学期校网络中心为提高同学们的上网使用感受，开通了高清电影，电视点播系统，具体使用方法请登录http://59.68.63.19。\n\n最后，希望我的回答对你提出的问题有帮助。。。\n\n', '2013-04-16 10:02:10', '487', '0', '0'), ('1291', '516c96d784c50', '\n下面是我了解到相关的流程，愿我的回答对你有帮助。\n\n中南民大学生、教工申请开通电子邮件工作流程 \n\n（一）电子邮箱简介\n\n          我校校园网目前使用的是亿邮邮件系统。该系统除能收发普通电子邮件外，还具有网络存储、自动转发、垃圾邮件过滤网关等功能，该系统会拦截被认为是垃圾的信件，但不会丢失任何邮件。一旦用户有邮件被拦截，系统会在当天给用户发送通知邮件。被拦截的邮件会被邮件系统保留15天。当用户收到垃圾邮件通知后．可点击信件标题链接，查看此邮件内容，以决定是删除还是继续投递，也可直接登录垃圾邮件过滤网关查看。方法如下：。\n          1、访问网址http://mail.scuec.edu.cn:8080/，在“用户名” 处输入的注册的邮件用户名，“密码”为用户邮箱密码。\n          2、登录垃圾邮件过滤网关系统后可查看和管理最近14天被拦截的垃圾邮件。\n\n（二）邮箱申请办法\n\n          邮箱空间统一为100M，网络存储空间为100M，上载附件上限为10M，信件数量上限为1000封。中心向单位用户和个人用户提供与用户所申请电子邮件帐号相关的电子邮件收发服务，单位和个人电子邮件用户的开户需要经过中心核实批准。办理办法：\n\n          1、受理范围限我校单位和教职员工。\n          2、教职工申请，可持本人工作证或人事处证明来网络技术中心办理。\n          3、学生申请，可持学生证或借阅证来网络技术中心办理。\n          4、单位申请，请持单位证明（证明需注明用户名、负责人及联系方式，并加盖部门公章）来网络技术中心办理。注意证明请严格按照以上需求填写，以备查询所用。\n\n          申请成功后，登录邮箱地址：http://mail.scuec.edu.cn/ ，初始密码统一为“申请证件号码”。也可由信息门户http://my.scuec.edu.cn/进入邮箱。进入邮箱后用户第一次登录时必须修改初始密码。密码设定原则：6位以上，由数字、字母及特殊字符组成。不要用生日、电话号码或门牌编号、车牌号等易被猜出的组合做邮箱密码。密码丢失者，请持相关证件或证明来中心修改密码。\n\n\n（三）邮件收发\n\n          使用学校的邮件系统收发电子邮件有两种方法：一种是基于OutlookExpress、Foxmail等邮件客户端软件的方式，另一种是基于Web的方式。\n\n          1、使用Web方式收发电子邮件的方法\n          登录地址：http://mail.scuec.edu.cn/ ，输入正确的帐号和密码，就可通过Web访问自己的邮箱，进入邮箱后点击网页右上端的“帮助”按钮可查看详细的邮箱操作指南。通过Web收发电子邮件的优点有：\n          (1)可免去邮件客户端软件复杂的设置过程；\n          (2)用户可通过不同的计算机上网收发邮件；\n\n          2、 使用OutlookExpress6.0收发电子邮件方法\n          (1) 电子邮箱申请成功后，需在本地机作如下设置：\n          打开Outlook或Foxmail，依次选择“工具”菜单→“帐户”菜单→“邮件”标签→“添加”按钮→“邮件” 菜单，按照提示顺序地进行以下设置：\n          • “显示名”输入自己的姓名：(例如张三)；\n          • “电子邮件地址”输入注册到的邮箱地址：(例如：zhangsan@mail.scuec.edu.cn)；\n          • “我的接收邮件的服务器是”POP3服务器；\n          • “接收邮件服务器”：mail.scuec.edu.cn； \n          • “发送邮件的服务器”：mail.scuec.edu.cn； \n          • “POP帐号名”输入所申请的账号：(例如：zhangsan)； \n          • “密码”：(如不是自己的专用电脑，建议不选择“记住密码”)； \n          • 选择“使用安全密码认证登录”； \n          • 点击“完成”按钮，结束初步设置。 \n          (2) 依次选择“工具”菜单→“帐户”菜单→“邮件”标签→“属性”按钮→ “服务器”标签→选择“我的服务器要求身份验证”(此项必须选，否则只能接收不能发送邮件) →点击“确定”按钮，完成设置。\n\n（四）常见问题及处理方法\n\n          1、用Web方式收发信时，如果邮箱空间已满，或邮件邮件达到1000封，将收不到新的信件，但可发信，因此，请—定注意及时清理自己的邮箱。\n          2、由于我校邮件服务器是使用Linux平台管理，用户名及密码区分英文大小写字母。因此在发信时，请不要写错对方邮件地址。\n          3、用OutlookExpress或foxmail收发信时只能收信不能发信，可依次选择“工具” 菜单→“帐户”菜单→“邮件”标签→“属性”按钮→“服务器”标签 →选择“我的(Smtp)服务器要求身份验证” (此项必须选，否则只能接收不能发送邮件) →点击“确定”按钮。\n          4、用OutlookExpress收发信件，附件打不开的原因可能是 OutlookExpress的安全选项中被设置成禁止打开附件。可在OutlookExpress中依次选择“工具”菜单→“选项”菜单 →“安全”标签→不选择“不允许打开可能有病毒的附件”。\n\n(五)　有关的说明\n\n          亿邮邮件系统自动设定定时查询邮件发送日志，遇到疑似发送垃圾邮件的帐号，会自动将该帐号锁定，直到疑似的发送垃圾邮件行为停止。遇有帐号被锁定的情况，请按以下操作进行：\n          1. 检查自己邮箱帐号是否被盗，密码设置是否过于简单。过于简单的密码较容易被木马等程序利用以发送垃圾邮件。\n          2. 检查本机的病毒防火墙与网络防火墙的自动防护是否打开，并对全盘进行杀毒及查杀木马。\n          3. 以上步骤完成后，持本人证件到网络中心解锁。', '2013-04-16 10:24:27', '485', '0', '0'), ('1292', '516c96d784c50', '\n这里有相关的文章，你可以参考一下。\n\n                 中南民大开通或托管服务器工作流程\n\n    (一)学校主页网站和各二级网站以虚拟主机的形式托管，虚拟主机设在校园网络主机房，并提供虚拟目录服务及一个仅用于本单位网站的专有域名，各单位网站内容可通过FTP方式及时更新，能提供可靠的技术支持并确保信息安全和网站24小时开通。动态网页空间采用CMS网站群平台实现。\n    (二)虚拟主机服务只向单位用户提供，虚拟主机具有独立的Web空间，通过FTP帐号管理。申请单位首先在网上下载并填写好《WEB虚拟主机或服务器托管申请表》，经单位领导审查盖章后报党委宣传部审查，最后交中心查办理。\n    (三)服务器托管服务只向单位用户提供。单位首先撰写报告，经单位领导审查盖章后报党委宣传部审查，然后交中心办理。\n    (四)单位托管的服务器由中心分配IP地址并指定放置位置，对于分配的IP地址，用户只有使用权，不得转借他人使用。\n    (五)未经允许，用户不得利用托管的服务器提供与学校教学、科研和管理无关的服务。一经发现，追究相关单位和负责人的责任。\n    (六)单位托管的服务器上请务必安装杀毒软件和防火墙软件，如托管服务器工作出现异常情况，相关单位应积极配合中心解决。 ', '2013-04-16 10:38:33', '484', '0', '0'), ('1293', '516c96d784c50', '你好！我来回答你的问题吧。\n\n                   教育储蓄证明办理流程\n \n1.登陆我们学校的学工在线网站，在下载专区下载《教育储蓄证明审批表》。\n2.认真填写审批表，并经学院辅导员及分党委审核盖章。\n3.学生持身份证及《教育储蓄证明审批表》至学工处学生事务科办理教育储蓄证明，学生务必清楚教育储蓄的开户行名称。\n\n注：学生工作处学生事务科位于大学生活动中心三楼，且学生事务科一般只在每周四下午受理此项申请。', '2013-04-16 10:42:56', '479', '0', '0'), ('1294', '516c96d784c50', ' 你可以登录财务处主页（http://cwc.scuec.edu.cn/），根据相关说明进行查询吧。\n\n\n\n', '2013-04-16 10:46:23', '481', '1', '0'), ('1295', '516c96d784c50', '\n\n英语考试须知流程：\n\n一 、报名时间\n全省考生报名时间由各考点根据湖北省教育考试院通知的第一次上报数据的时间自行确定。\n二、报名资格\n全日制普通高等院校本科、专科、研究生和各类全日制成人高等院校（含高等教育自学考试全日制助学班）本科、专科的在校生,修完大学英语四级课程，可报考CET4；报考CET6的在校生必须修完大学英语六级课程且持425分（含425分）以上CET4成绩单。\n本校已设考点的在校学生不得跨校参加考试，考点不得接收非法报名点的集体报名。在考试中被认定为作弊和雷同答卷的考生，依据国家考试的相关规定，取消考试成绩，一年内不允许参加CET考试。\n三、报名组织与实施\n1．考生报名时提供学生证和有效身份证件（身份证、军人及武警人员证件、户口本、公安户籍部门开具的张贴有近期免冠照片的身份证号码证明和护照）；\n2．考生认真填写自己的考试报名信息，考生照片由学校统一采集（严格按照照片采集标准采集）。\n3．学校准确录入考生报名信息，打印考生报名信息的核对文本，经考生确认相关内容无误并在指定位置签字确认，同时签订《诚信考试承诺书》。（考生签名的报名信息确认单及诚信考试承诺书必须保存到考试结束之日起6个月后才能销毁）\n4．生僻字名单。软件系统中无法打出考生姓名的字，请统一用下划线“＿”表示（如李＿丽）；各校按考试语种统一写明并加盖公章上报（内容包括：语种、考生姓名、准考证号、学号、身份证号）。\n 四、准考证的领取\n准考证的领取由考点负责并在考前通知考生。\n五、成绩发布\n考试成绩于考试结束之日起60个工作日后向社会公布。成绩单于考试结束之日起90个工作日后发放给考点。考生如对成绩有疑问、补办成绩证明等情况可登陆www.cet.edu.cn查询。 \n', '2013-04-16 10:51:06', '483', '0', '0'), ('1296', '516c9957b8af3', '嘿嘿，这里有你需要的答案。\n1.学生登陆&quot;学工在线&quot;下载专区下载《中南民族大学学生证（校徽）补办申请表》并打印；\n2.按要求填写申请表，并贴近期一寸免冠照一张；\n3.申请表交年级辅导员签字，学院分党委审核并加盖骑缝章；\n4.学生凭此申请表，另备同底照片一张，按照学生工作部通知的学生证补办时间至学生工作处学生事务科(大学生活动中心三楼)办理补办手续。补办学生证需交工本费10元。\n5、学生证补办工作每学期集中办理一次，一般安排在5月下旬及12月下旬，具体时间以学生工作部通知为准。\n \n火车票优惠IC卡已用完四次的同学请在学生工作部通知的时间到学生事务科（大学生活动中心三楼）充值。\n', '2013-04-16 11:05:07', '491', '0', '0'), ('1297', '516c96d784c50', '你携带学生证直接到大学生活动中心三楼学工部学生事务科办理。', '2013-04-16 11:15:34', '492', '0', '0'), ('1298', '516c96d784c50', '首先，请到所属学院做书面申请；待学院初审通过后请到大学生活动中心三楼学工部事务科复审；最后，将证明交予保卫处户籍异动室办理。\n', '2013-04-16 11:37:36', '493', '0', '0'), ('1299', '516c96d784c50', '请注意！当你请的假期超过10天（含）时，首先，你向所属学院做书面申请；其次，等学院审核通过后请交予学工部（处）批准；最后，在学生返校后及时向学院销假。\n', '2013-04-16 11:39:54', '494', '0', '0'), ('1300', '516c96d784c50', '首先，请到所属学院做书面申请；再者，待学院初审通过后，请到大学生活动中心三楼学工部学生管理科复审；最后，将证明交予后勤保障处宿舍管理中心办理。\n', '2013-04-16 11:42:31', '495', '1', '0'), ('1301', '516c96d784c50', '首先，请到学工在线下载区下载《荣誉证书补办申请表》表格；其次，到大学生活动中心三楼学工部教育科审核后办理（一般时间在每年5月与9月集中办理，具体时间以学生工作部通知为准）。\n', '2013-04-16 11:48:46', '496', '0', '0'), ('1302', '516c96d784c50', '首先，请到所属学院提交相关材料（材料内容请查询学工在线学生资助网）；然后，材料交到大学生活动中心三楼学生资助管理中心进行初审；再者，经办银行审批后签订借款合同；最后，贷款的发放。\n', '2013-04-16 11:51:48', '497', '0', '0'), ('1303', '516c96d784c50', '首先，请到所属学院提交相关材料进行经济困难认定；其次，向学院提交勤工助学申请书；最后，学院安排流动勤工助学岗位（固定岗位勤工助学人员由校勤工部每年9月统一招聘）。\n', '2013-04-16 11:54:29', '498', '0', '0'), ('1304', '51666f1480499', '这个可以到大学生活动中心三楼学生工作部事务科咨询。', '2013-04-16 12:07:34', '492', '0', '0'), ('1305', '516c9957b8af3', '1、网络技术中心领取上网IP条 \n2、南区超市购买上网充值卡\n3、配置好分配的IP地址参数，登陆http://172.16.0.2/selfLogon.do输入账号和密码(初始为8888)进行自助充值\n4、完成充值，下载并安装“安腾蝴蝶”客户端，连接网线到墙上网络端口，键入账号密码可上网\n\n（服务电话：027-67843672）\n', '2013-04-16 12:17:28', '500', '1', '0'), ('1306', '51604110cfed9', '很贵的，不过第一次去可以办个会员，80块试唱两个小时，而且还有一大堆优惠券不过都很坑。', '2013-04-16 15:21:20', '462', '0', '1'), ('1307', '51614ae439b6d', '回答：中南民族大学学生奖学金评选办法\n为鼓励学生在校期间刻苦学习、奋发向上，充分发挥学生的特长和创造才能，促进学生德、智、体、美等方面全面发展，努力培养社会主义事业的合格建设者和可靠接班人，根据国家有关文件精神，并结合我校实际，特制定本办法。\n第一章             奖学金种类及评选范围\n第一条  评选范围：取得我校学籍的全日制普通本、专(高职)、预科学生。\n第二条  奖学金种类：\n一、民族类专业奖学金。分每生每年1200元、900元、600元三等，评选比例分别为该专业在校生人数的5%、10%、20%。\n二、优秀学生奖学金。分每生每年1200元、900元、600元三等，评选比例分别为各非民族类专业在校生数的3%、7%、15%。\n三、三好学生标兵奖学金。按各院（部）普通本、专科（高职）学生人数的1‰评选，院（部）学生人数不足1000人的可评选1人。预科部学生不参加评选。三好学生标兵奖励金额为1500元/人\n四、三好学生奖学金。按各院（部）在校生人数的3%评选，奖励金额800元/人。\n五、优秀学生干部奖学金。按各院（部）在校学生人数的2%评选，奖励金额500元/人。\n六、文艺、体育优秀奖。分甲、乙、丙三等，奖励金额分别为每生500元、300元、100元。在省、市或高校组织的文艺、体育竞赛中获第一名者可获甲等奖；获第二、三名者为乙等奖；第四名及以下名次者可获丙等奖；集体项目奖金额为：第一名800元，第二、三名500元，第四名及以下者200元。在校体育运动会上破记录者，奖金为100元/人。\n七、吴泽霖教授奖学金。分2000元、1500元、1000元三等。\n八、创新奖学金。按学校创新奖学金评选办法组织评选。\n九、贫困学生奖学金：\n1、国家助学奖学金，包括国家奖学金和国家助学金，国家奖学金额为8000元/人，国家助学金金额为每生每月150元，每年发放10个月，全年计1500元。国家助学奖学金受奖比例，按当年下达的指标评选。\n2、松下育英奖学金。每生每年奖励金额为500元。 第三条  民族类专业奖学金和优秀学生奖学金按学年度评选。\n第四条  民族类专业奖学金和优秀学生奖学金不能重复评选；校三好学生标兵和校三好学生不能重复评选，但可以和其他奖学金重复评选；国家奖学金和松下育英奖学金不能重复评选。\n第二章            评选条件\n第五条  所有参评学生，都必须坚持四项基本原则，遵守国家法律、法规和学校的各项规章制度，本学年度无违纪情况。凡受过留校察看处分的学生，两年内不能参加各类奖学金的评选。\n第六条  保留入学资格、休学或因其他原因学习时间不足一学年的学生，只能参加文艺、体育优秀奖、创新奖学金的评选。\n第七条  参加优秀学生奖学金、民族类专业奖学金评选的学生，评选年度不得有不及格课程。\n第八条  暑假不参加社会实践活动或虽参加但不提交调查报告或调查报告被评为不合格者，不能参加各类奖学金的评选。\n第九条  优秀学生奖学金一等奖要求学年总评成绩在85分（含85分）以上，从第二学年开始，英语必须达到学校规定的标准；二等奖要求学年总评成绩在80分（含80分）以上，从第二学年开始，英语必须达到学校规定的标准；三等奖要求学年总评成绩在75分（含75分）以上。\n参加优秀学生奖学金的评选者都必须达到国家体育锻炼标准。\n第十条  民族类专业奖学金和优秀学生奖学金，如符合一等奖学金条件的学生不足，不足名额不能转换为二等奖指标，依此类推。\n第十一条  三好学生、优秀学生干部的评选条件，按《中南民族大学关于“三好学生标兵”“三好学生”“优秀学生干部”“先进班集体”和个人单项优秀奖评选细则》执行。\n第十二条  吴泽霖教授奖学金的评选条件，按《中南民族大学吴泽霖教授奖学金评选的有关规定》执行。\n第三章  评选工作程序\n第十三条  民族类专业奖学金和优秀学生奖学金，由各院（部）在每学年初按本办法规定的比例组织评选，并将选出的名单及相应学习成绩等报学生工作处审核；学生工作处审核后报主管校领导审批。财务处根据审批后的名单向各院（部）发放奖学金，学生到本院（部）签名领取。\n第十四条  校三好学生标兵、校三好学生、校优秀学生干部评选工作由学生工作处在每学年初根据《中南民族大学关于“三好学生”“优秀学生干部” “先进班集体”和个人单项优秀奖评选细则》组织评选。\n第十五条  文艺、体育优秀奖，由学生本人提出申请，院（部）审核后，学生凭有关证书、证明直接到学生工作处开具领奖收据到校财务处领取。\n第十六条  吴泽霖教授奖学金在每年五月依据《中南民族大学吴泽霖教授奖学金评选的有关规定》组织组织评选。\n第十七条  创新奖学金由教务处组织评选。\n第十八条  国家助学奖学金依据《中南民族大学国家助学奖学金管理实施办法》由学生工作处组织评选。\n第十九条  松下育英奖学金由学生工作处根据相关规定组织评选。\n第四章评选工作要求\n第二十条  各学院（部）要高度重视奖学金的评选工作，要成立由分管领导、辅导员、班主任、学生代表组成的评选小组来认真评选。在评选工作中，要认真核实学生的有材料，严格程序，坚持民主、公平、公开的原则，将拟评奖名单予以公示，确保评选结果的公正性。\n第五章附则\n第二十一条  本办法的解释权在学生工作处。第二十二条  本办法从2005年9月1日起施行。第二十三条  研究生部、成人教育学院学生奖学金的评选办法另行制定。', '2013-04-16 15:50:48', '501', '2', '1'), ('1308', '51614e352b33e', '确实快了点。', '2013-04-16 21:03:47', '502', '0', '1'), ('1309', '515bccf8c3749', '现在变快了。。。', '2013-04-16 21:05:04', '499', '0', '1'), ('1310', '5163f62f38368', '好快的样子。', '2013-04-16 21:08:28', '502', '1', '1'), ('1311', '5163f62f38368', '校内人员拿学生证去就可以免费，每周一至周五上午9:00—11:30；下午2:30—4:30（提前半天预约，双休、国家法定节假日实行有偿服务）。', '2013-04-16 21:10:57', '489', '1', '1'), ('1312', '516c9f95eeca0', '楼上的回答好正式啊、', '2013-04-16 21:15:05', '500', '0', '0'), ('131