线下跟市场一起', '2013-05-18 14:32:04', '557', '1', '1'), ('1509', '515e6627923c7', '下周出大购墙海报~', '2013-05-18 16:43:45', '557', '1', '1'), ('1510', '515e6c521a23d', '6月2', '2013-05-19 13:38:18', '550', '0', '0'), ('1511', '518eccfe12cc2', '我怎么感觉很多人愿意在外人面前表现坚强，因为不想自己的悲伤被别人知道；在自己在乎的人面前装坚强是不想让他看到你软弱吧，不想让他担心', '2013-05-19 17:32:32', '559', '0', '1'), ('1512', '518e2d4c03e16', '为了给他/她留个好印象', '2013-05-21 00:09:21', '559', '0', '1'), ('1513', '518e2d4c03e16', '对比来看米聊，其发展早于微信，但微信却率先推出可以搜索QQ好友列表的好友，米聊一开始打着做熟人社区的旗号，可以跟通讯录上的朋友交流，熟人搜索功能却晚于微信推出。后期微信向陌生人交友扩展，最终促使微信爆红，这更加和QQ的关系列表优势已经没什么联系了。 微信版本迭代相当快，相关功能摇一摇、周边发展迅速，再加上适当的运营推广，捕获粉丝是自然而然的事情。米聊失去了发展成为微信或者陌陌的机会，再者，又因为“传图不畅、语音卡”等问题一直得不到解决，米聊的用户流失得相当快。从功能的角度来看，微信跟米聊很相似，都是以熟人间的即时通讯作为核心，同时又加入了很多移动SNS的成分。例如，两者都有点对点聊天、全聊的功能，都可以语音聊天，都能够发送表情和图片。不过，这两个产品也各自有一些不同的特点：米聊的“广播“功能很有特色，你可以通过“大喇叭“吼一嗓子给所有的好友听。', '2013-05-21 00:28:26', '558', '2', '0'), ('1514', '5199eee58b10b', 'ok', '2013-05-21 16:41:27', '560', '0', '1'), ('1515', '5199eee58b10b', 'ok', '2013-05-21 16:44:38', '556', '0', '1'), ('1516', '5199eee58b10b', '慧神，什么时候来大活啊。。', '2013-05-21 16:57:08', '560', '0', '1'), ('1517', '51615f98e5068', '刷微博~~', '2013-05-21 18:21:27', '560', '1', '1'), ('1518', '518eccfe12cc2', '好久不见慧神了~~~~', '2013-05-21 18:29:26', '560', '0', '1'), ('1519', '515e6c521a23d', '睡前喝点牛奶，9点多时区外面跑跑步，运动下，出完汗再洗个热水澡', '2013-05-21 20:08:19', '560', '0', '1'), ('1520', '518e2d4c03e16', '失眠的原因分析：（1）精神压力过大，这是最常见的原因。许多失眠的人被认为是紧张过度，不易松驰。生活、工作中的各种矛盾和困难所造成的焦虑、抑郁、紧张、激动、愤怒或思虑过多都会让他们失眠。（2）生活起居不规律，高强度脑力劳动，体力活动过少。长期坐在教室寝室或办公室，缺乏运动易患失眠。（3）环境因素影响。睡眠中有强光、噪声；卧室内温度过高或过低；吸血昆虫的骚扰；不舒服的床铺、被褥。\n据以上分析我们可以对症下药，解决问题。先提供几种常用的有效的方法：\n食疗法：睡前如有需要，可适度进食；牛奶、面包、饼干之类食物，有助于睡眠。\n运动法：睡前一个小时，围绕操场跑三圈，再做30个俯卧撑。\n环境法：床要软，不要太硬。运用物理、化学、生物法，使不被蚊虫叮咬。室内安      静，无吵闹。打开风扇，不要太热。\n学习法：失眠时，一般精神状态是比较好的。这时，可以拿本自己觉得比较难或者没有学会的书来看，看不下去的时候就可以睡了。\n药物法：适量吃点安眠药，有助于睡眠。\n暴力法：睡前撞下墙，不要太用力，也不要太轻，刚刚把自己撞晕最好。\n人品法：把分儿给我。', '2013-05-21 20:41:53', '560', '2', '1'), ('1521', '515bccf8c3749', '这个我只能说暑假可以住宿舍，夏天天气也很热，至于去哪里实习这个要看你自己了！！！', '2013-05-21 20:49:56