, '1'), ('1563', '515e6947790b0', '这个会寄到自己班级的信箱哪里，我们班的是在和辅导员一个楼层的地方，由班级的生活委员负责去拿。', '2013-06-14 07:59:52', '588', '1', '1'), ('1564', '515e6947790b0', '有的大学之所以在一些省市区按一本招生，主要因素是；\n     一是地域比这些省市区要好；\n     二是这些省市区的高等教育相对落后，\n     三是这个大学的主干专业在这些省市区就业较好【像山东省冶金工业发展很快，          但没有一所冶金类大学】。\n    之所以在有的省市按二本招生，主要考虑的因素有两点，一是地域不如这些省市，而是高等教育不如这些省市【如武汉科技大学在全国好多省市按一本招生，但在三大直辖市和陕西却按二本招生】', '2013-06-14 08:17:07', '587', '1', '1'), ('1565', '515e6947790b0', '仅供参考！！！\n怎样认识比你优秀的人并和他们成为朋友——把你自己的每一件事做好。\n原因很简单：因为你有你的价值，你可以做成事，这件事可能很小，但是一定需要人来做，而你能做好。而很多优秀的人很忙，但是他们有很多小事需要做，而且不得不做，所以他们喜欢能做成事的人，把这些小事做好。而这，就是第一步。一旦开始合作，一步一步，你们就成了很好的伙伴。\n不觉得这句话如此的容易，却又被忽视已久了么？\n那就举个例子吧：\nA是大学生，学计算机的，零基础。上大学第一门专业课，C。因为学校要求很高，所以所有人的压力都很大。\n有的人有基础，所以可以很轻松，有的人因为压力大，开始退缩，进而开始开始抱怨代码无用。A没什么感觉，就觉得既然是门课，我就好好学。不卑不亢。不懂就问，把不知道的都弄清楚了。作业非常认真地完成，虽有错误，但是改错积极。\n最后大作业，大神们开始用高级的数据结构写高级玩意，弱逼们开始到处复制粘贴代码。A就选了老师推荐的题目——计算器。没什么特别，但是，A把一个简简单单的控制台计算器做到了极致，处理了所有人想到甚至想不到的诡异错误。一个控制台计算器怎么玩，都不会崩溃。\n最后分高吗？不高，因为计算器太常规，没有加分。\n但是，这份作业深深打动了助教！助教拉他进了实验室，不做别的，就只做处理数据，从最基础的开始，读入数据，转换格式，输出数据。\n后来，不断地处理数据中，他开始跟着做实验，开始有自己的课题，开始撰写自己的论文。但其实，每上一步，他其实都是帮着大牛做简单的活。但他一直在进步。\n他成了第一个发paper的人，他懂得比同龄人都多，他的科研一路顺着。还记得最早是为什么？因为他把一个简单的计算器做的认真，就这么简单。\n跟比你优秀的人成为朋友，一定是因为你有能力，虽然跟他们相比可能微不足道，但是你要能把你应该做的做好。他们需要你来做一些事情，你把这些事情做好了，你们就会成为伙伴。', '2013-06-14 08:20:09', '584', '1', '0'), ('1566', '515e6947790b0', '自问自答一个，算是分享吧。\n其实是来自             “  06年的武林外传，钱掌柜让李大嘴做月饼，既要高端大气上档次，又要犹抱琵琶半遮面”', '2013-06-14 08:29:32', '591', '2', '1'), ('1567', '51616f2c6f8d8', '会自发形成兴趣小组，即社团。那样其实氛围更高，只是传承性不稳定，如果久了自然就成了社团', '2013-06-14 10:41:17', '590', '1', '1'), ('1568', '515bccf8c3749', '为我收集的吧！！！', '2013-06-14 10:52:18', '592', '0', '1'), ('1569', '515bccf8c3749', '现在好像搬到行政楼去了，具体在几楼，不知道！！！', '2013-06-14 15:06:21', '593', '0', '1'), ('1570', '515bccf8c3749', '同意楼上的说法，其实社团也是从兴趣小组发展过来的，有了好的传承机制和发展后就成为了社团了。', '2013-06-14 15:08:56', '590', '0', '1'), ('1571', '515bccf8c3749', '赞！！！', '2013-06-14 15:09:17', '591', '0', '1'), ('1572', '5166b1ee01999', '依据收信人的地点而定，如果写的是学院班级，就去院里拿，如果是寝室，就去大活拿。', '2013-0