 '515bccf8c3749', '直接回家吧，不要留在武汉了。', '2013-06-22 15:12:53', '603', '0', '0'), ('1618', '515bccf8c3749', 'evernote,zaker', '2013-06-22 22:35:28', '604', '1', '1'), ('1619', '515bccf8c3749', '这个是学生地带下面的一个子站，所以用了学生地带的子域，谢谢多关注下学生地带主站啊！！！', '2013-06-23 16:35:18', '605', '1', '0'), ('1620', '5163f62f38368', '应该是 登录，不过 故问 又引出故意找问题的，所以这不是大问题。', '2013-06-24 23:23:30', '607', '0', '1'), ('1621', '5163f62f38368', '应该是 登录，不过 故问 又引出故意找问题的，所以这不是大问题。', '2013-06-24 23:23:31', '607', '0', '1'), ('1622', '5163f62f38368', '应该是 登录，不过 故问 又引出故意找问题的，所以这不是大问题。', '2013-06-24 23:23:32', '607', '0', '1'), ('1623', '5163f62f38368', '应该是 登录，不过 故问 又引出故意找问题的，所以这不是大问题。', '2013-06-24 23:23:32', '607', '0', '1'), ('1624', '5163f62f38368', '应该是 登录，不过 故问 又引出故意找问题的，所以这不是大问题。', '2013-06-24 23:23:33', '607', '0', '1'), ('1625', '515bccf8c3749', '这个还是有问题的，大家一起努力啊！！！', '2013-06-25 14:55:22', '608', '0', '1'), ('1626', '515e6947790b0', '忙于考试\n好奇心下去了\n找不到自己想要的东西\n很多人感觉在这上面没有事做\n宣传不够\n互动较低\n', '2013-06-26 20:53:56', '608', '1', '1'), ('1627', '515ecaf6d45fd', '关于做好2013年生源地信用助学贷款申请工作的通知\n\n各学院： \n本学期即将结束,为帮助家庭经济困难学生暑期申办2013年生源地信用助学贷款，现将有关事项通知如下： \n一、申贷对象\n我校全日制本科、研究生在校生中的家庭经济困难学生。\n二、申贷条件\n1、具有中华人民共和国国籍；\n2、诚实守信，遵纪守法，无违法违纪记录；\n3、家庭经济困难，所能获得的收入不足以支付在校期间完成学业所需的基本费用。\n三、贷款种类\n1、国家开发银行生源地信用助学贷款；\n2、农村合作金融机构生源地信用助学贷款。\n注：同一学生同一学年内只能申请其中一种。\n四、办理程序及时间安排\n1、学生申请\n符合条件的学生申请国家开发银行（登录https://sls.cdb.com.cn/在线申请）或者农村合作金融机构生源地信用助学贷款，在“学生资助网——下载专区”的《在校生申请国家生源地助学贷款证明》中下载填写并打印《湖北省生源地信用助学贷款家庭经济困难证明》附件1或《申请外省生源地信用助学贷款家庭经济困难证明》附件2（以下简称“生源地证明”），并将学费和住宿费均按学校收费标准填写，每人每年最高不超过6000元。\n2、学院审核盖章\n学院审核证明信息并加盖公章后到校资助管理中心审核盖章。\n3、具体办理流程（时间：7月至9月）\n申请国家开发银行生源地信用助学贷款的学生离校前到国家开发银行学生在线服务系统进行网上申请，并于2013年8月至9月期间携带本人及共同借款人身份证、家庭户口簿、学生证，到当地县（市、区）教育局学生资助管理部门现场申请办理。\n申请农村合作金融机构生源地信用助学贷款的学生，于2013年8月1日-10月20日期间携带学校开具的生源地证明、本人身份证、学生证及父母或者其他法定监护人的身份证、家庭户口簿，到入学前户籍所在地农村合作金融机构申请办理。\n注：上述提到的证件需原件和复印件，具体所需材料请咨询当地资助管理部门。\n4、信息确认（9月份后）\n办理国家开发银行生源地信用助学贷款的学生于9月10日前将注明欠费总金额的《国家开发银行生源地信用助学贷款受理证明》交学院，由学院统一报校学生资助管理中心办理电子回执信息确认手续。\n所有申请生源地助学贷款的学生要将合同和农村合作金融机构开具的联行凭证复印件提交给学院。由学院统一报校学生资助管理中心。\n五、注意事项\n生源地信用助学贷款是国家完善高校家庭经济困难学生资助政策体系的重要举措，事关家庭经济困难学生的切身利益，请各学院高度重视，认真抓好落实。\n', '2013-06-27 21:54:22', '609', '1', '1'), ('1628', '519dd7b0cecb9', '同问啊。。。我也有同学是这种现象。。。怎么没人给回答啊？', '2013-07-04 18:06:07', '606', '0', '0'), ('1629', '5163f62f38368', '想做什么就做什么就是为所欲为吧。', '2013-07-09 12:56:08', '612', '0', '0'), ('1630', '515bccf8c3749', 'colorwork是一个协作工具。', '2013-07-20 00:52:33', '613', '1', '1'), ('1631', '51ee958a066b2', 'Colorwork通过创造平行的团队私密社交平台，为个人提供高效简单的团队工作方式，用户可以在所属的不同社团，课程小组，班级之间进行便捷的沟通，利用团队内部类似微博的形式让沟通更加平等、流畅、积极，让您摆脱群发邮件的繁杂烦恼。', '2013-07-23 22:43:07', '613', '1', '1'), ('1632', '515e6947790b0', '你应该问colorwork哪里不好？哪里好', '2013-07-23 22:45:34', '613', '1', '1'), ('1633', '5166d0439cb44', '\n-\n  我也不知道，但是目前知道这两个时间比较长，\n武术协会——20多年的历史，和中华文明一样没有“断代”。指导老师是武汉体育学院毕业的武林高手吴文雄老师，每天都在训练，风雨无阻，曾9年蝉联湖北冠军；会员从大一到研三7世同堂在训练。 \n\n     未来管理者协会——生于1987，按照“公司”的管理模式来运行，创造性地提出了“模拟管理”，在相应情景下感受管理效益、洞悉企业风云。“经管论坛”“经济管理案例分析大赛”,联合其他社团共同举办了首届模拟人才招聘会”，与神龙公司、武汉钢铁集团等知名企业保持长期的良好联系，定期组织会员实地考察、参观，一年一度的“野外生存训练”。 \n-\n\n具体的你可以具体在这里问，会有我们会邀请社团负责人来回答的。 希望对你有帮助', '2013-07-25 14:55:56', '614', '0', '1'), ('1634', '515e6947790b0', '\n-\n不多说招新群 84061677         备注可以是“故问”\n-', '2013-07-27 23:07:26', '615', '1', '1'), ('1635', '515e6947790b0', '-\n故问的开发者比特工场    群号  84061677                 备注可以是“故问”\n-\n获得各种奖项的学校最好的话剧社团  336354772     在整个武汉都很厉害的哦\n-\n不多说日语协会    群号 321758665\n-\n经营自我，挑战自我，完善自我，超越自我！的市场研究协会   群号 140133383\n-\n在表演的同时感受生活，感受自我，完善自我的街舞协会   群号 90215576\n-\n艺术家的交响乐团  群号 325022009\n-\n文艺的摄影协会  群号  群号 278836886\n-\n轮滑不止 青春不败 ！影翼轮滑协会  群号   336764222\n-\n环保主义的践行者   绿色环保协会   群号   329533253\n-\n武汉高校中仅有三所高校女子协会之一 晨曦女子协会 群号   328302051\n-\n热爱吉他 热爱音乐  第七弦吉他协会  群号   329176800\n-\n当然还有好多好多，像情商协会、留学生协会、网球协会，能力有限欢迎补充，具体信息你可以在这里提问。\n-', '2013-07-28 09:51:38', '616', '5', '1'), ('1636', '515e6947790b0', '-\n①不要相信高中老师的话上大学你就轻松了\n②无论北方南方的同学一定要做好冬天比你家里冷，夏天比你家里热的准备\n③如果你是个不想减肥的学妹那么可以买辆自行车\n④如果对自己专业不满意你开学可以转专业的哦，或者可以学双学位的哦\n⑤北区女生宿舍正在装空调哦，\n⑥买东西进点可以去对面财大北苑，关谷，远点的可以去汉正街...\n-\n学长也只来过一年哦', '2013-0