-- ----------------------------
DROP TABLE IF EXISTS `guwen_answer_reply`;
CREATE TABLE `guwen_answer_reply` (
  `id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `aid` varchar(16) NOT NULL COMMENT '回答的id',
  `uid` varchar(16) NOT NULL,
  `content` text NOT NULL,
  `ctime` datetime NOT NULL,
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '是否被查收',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  KEY `uid` (`uid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=931 DEFAULT CHARSET=utf8;

