查看私信详情。<br />\n	8.	在个人页面您可以查看“我的提问”、“我的回答”<br />\n	9.	在设置页面您可以修改基本资料、头像、账号密码<br />\n	10.	提出问题得到解答后，您可以选择其中一个回答设置为最佳答案<br />	11.	你可以评论其他人的回答，也可以对其他人的回答进行赞<br />\n\n	详见<a href=\"http://guwen.huip.org/index.php/index\">故问指南</a>', '1', '2013-04-07 15:32:23'), ('249', '51612107db8f6', '51612107db8f6', '&lt;script&gt;alert(/xss/)&lt;/script&gt;111\'', '1', '2013-04-07 15:33:37'), ('250', '51614ae439b6d', '51613d067237e', '欢迎加入故问，故问是基于校园的问答社区，在这里你可以找到感兴趣的问题，\n		    回答别人的问题，赞同别人的回答，拓展大家的交友范围。\n\n使用方法\n	1.	在搜索框中您可以搜索想要的问题<br />\n	2.	你可以点击“创建问题”提出你的问题，等待其他用户的解答<br />\n	3.	在首页你可以看到，当前网站中最新的提问<br />\n	4.	在分类页面你可以看到当前分类中最新的问题纪录，可以快速找到你可能感兴趣的问题<br />\n	5.	在发现页面中，你可以快速找到当前很火的问题，并进行浏览<br />\n	6.	如果您在登录状态，你可以看到导航栏中的消息按钮,在这里你可以看到，谁回复了你，<br /> 		回答了你， 谁赞了你，谁把你的答案设为最佳答案<br />\n	7.	在私信模块你可以给其他用户发私信，并查看私信详情。<br />\n	8.	在个人页面您可以查看“我的提问”、“我的回答”<br />\n	9.	在设置页面您可以修改基本资料、头像、账号密码<br />\n	10.	提出问题得到解答后，您可以选择其中一个回答设置为最佳答案<br />	11.	你可以评论其他人的回答，也可以对其他人的回答进行赞<br />\n\n	详见<a href=\"http://guwen.stuzone.com/index.php/index\">故问指南</a>', '1', '2013-04-07 17:31:50'), ('251', '51614ae439b6d', '51613d77af835', '欢迎加入故问，故问是基于校园的问答社区，在这里你可以找到感兴趣的问题，\n		    回答别人的问题，赞同别人的回答，拓展大家的交友范围。\n\n使用方法\n	1.	在搜索框中您可以搜索想要的问题<br />\n	2.	你可以点击“创建问题”提出你的问题，等待其他用户的解答<br />\n	3.	在首页你可以看到，当前网站中最新的提问<br />\n	4.	在分类页面你可以看到当前分类中最新的问题纪录，可以快速找到你可能感兴趣的问题<br />\n	5.	在发现页面中，你可以快速找到当前很火的问题，并进行浏览<br />\n	6.	如果您在登录状态，你可以看到导航栏中的消息按钮,在这里你可以看到，谁回复了你，<br /> 		回答了你， 谁赞了你，谁把你的答案设为最佳答案<br />\n	7.	在私信模块你可以给其他用户发私信，并查看私信详情。<br />\n	8.	在个人页面您可以查看“我的提问”、“我的回答”<br />\n	9.	在设置页面您可以修改基本资料、头像、账号密码<br />\n	10.	提出问题得到解答后，您可以选择其中一个回答设置为最佳答案<br />	11.	你可以评论其他人的回答，也可以对其他人的回答进行赞<br />\n\n	详见<a href=\"http://guwen.stuzone.com/index.php/index\">故问指南</a>', '1', '2013-04-07 17:33:43'), ('252', '51614ae439b6d', '51614ae439b6d', '欢迎加入故问，故问是基于校园的问答社区，在这里你可以找到感兴趣的问题，\n		    回答别人的问题，赞同别人的回答，拓展大家的交友范围。\n\n使用方法\n	1.	在搜索框中您可以搜索想要的问题<br />\n	2.	你可以点击“创建问题”提出你的问题，等待其他用户的解答<br />\n	3.	在首页你可以看到，当前网站中最新的提问<br />\n	4.	在分类页面你可以看到当前分类中最新的问题纪录，可以快速找到你可能感兴趣的问题<br />\n	5.	在发现页面中