INSERT INTO `guwen_inbox` VALUES ('437', '51614ae439b6d', '515bccf8c3749', '欢迎加入故问，故问是基于校园的问答社区，在这里你可以找到感兴趣的问题，\n		    回答别人的问题，赞同别人的回答，拓展大家的交友范围。\n\n使用方法\n	1.	在搜索框中您可以搜索想要的问题<br />\n	2.	你可以点击“创建问题”提出你的问题，等待其他用户的解答<br />\n	3.	在首页你可以看到，当前网站中最新的提问<br />\n	4.	在分类页面你可以看到当前分类中最新的问题纪录，可以快速找到你可能感兴趣的问题<br />\n	5.	在发现页面中，你可以快速找到当前很火的问题，并进行浏览<br />\n	6.	如果您在登录状态，你可以看到导航栏中的消息按钮,在这里你可以看到，谁回复了你，<br /> 		回答了你， 谁赞了你，谁把你的答案设为最佳答案<br />\n	7.	在私信模块你可以给其他用户发私信，并查看私信详情。<br />\n	8.	在个人页面您可以查看“我的提问”、“我的回答”<br />\n	9.	在设置页面您可以修改基本资料、头像、账号密码<br />\n	10.	提出问题得到解答后，您可以选择其中一个回答设置为最佳答案<br />	11.	你可以评论其他人的回答，也可以对其他人的回答进行赞<br />\n\n	详见<a href=\"http://guwen.stuzone.com/index.php/index/help\">故问指南</a>', '1', '2013-04-30 13:49:56'), ('438', '517f5b84138cb', '515bccf8c3749', 'hi', '1', '2013-04-30 13:58:33'), ('439', '517f5b84138cb', '515bccf8c3749', '可以这样发私信吗？', '1', '2013-04-30 14:01:26'), ('440', '517f5b84138cb', '515bccf8c3749', '真的可以吗？', '1', '2013-04-30 14:02:03'), ('441', '517f5b84138cb', '5167d9df854a4', 'hi', '1', '2013-04-30 20:05:29'), ('442', '517f5b84138cb', '5167d9df854a4', 'hi', '1', '2013-04-30 20:05:52'), ('443', '517f5b84138cb', '5167d9df854a4', '为毛我不能发私信？', '1', '2013-04-30 20:06:14'), ('444', '51614ae439b6d', '5167d9df854a4', '欢迎加入故问，故问是基于校园的问答社区，在这里你可以找到感兴趣的问题，\n		    回答别人的问题，赞同别人的回答，拓展大家的交友范围。\n\n使用方法\n	1.	在搜索框中您可以搜索想要的问题<br />\n	2.	你可以点击“创建问题”提出你的问题，等待其他用户的解答<br />\n	3.	在首页你可以看到，当前网站中最新的提问<br />\n	4.	在分类页面你可以看到当前分类中最新的问题纪录，可以快速找到你可能感兴趣的问题<br />\n	5.	在发现页面中，你可以快速找到当前很火的问题，并进行浏览<br />\n	6.	如果您在登录状态，你可以看到导航栏中的消息按钮,在这里你可以看到，谁回复了你，<br /> 		回答了你， 谁赞了你，谁把你的答案设为最佳答案<br />\n	7.	在私信模块你可以给其他用户发私信，并查看私信详情。<br />\n	8.	在个人页面您可以查看“我的提问”、“我的回答”<br />\n	9.	在设置页面您可以修改基本资料、头像、账号密码<br />\n	10.	提出问题得到解答后，您可以选择其中一个回答设置为最佳答案<br />	11.	你可以评论其他人的回答，也可以对其他人的回答进行赞<br />\n\n	详见<a href=\"http://guwen.stuzone.com/index.php/index/help\">故问指南</a>', '1', '2013-05-01 00:51:32'), ('445', '51614ae439b6d', '5180c32de00bb', '欢迎加入故问，故问是基于校园的问答社区，在这里你可以找到感兴趣的问题，\n		    回答别人的问题，赞同别人的回答，拓展大家的交友范围。\n\n使用方法\n	1.	在搜索框中您可