-- ----------------------------
--  Table structure for `guwen_inbox_link`
-- ----------------------------
DROP TABLE IF EXISTS `guwen_inbox_link`;
CREATE TABLE `guwen_inbox_link` (
  `id` mediumint(16) NOT NULL AUTO_INCREMENT,
  `my_id` varchar(16) NOT NULL,
  `to_id` varchar(16) NOT NULL,
  `time` datetime NOT NULL,
  PRIMARY KEY (`id`,`my_id`,`to_id`)
) ENGINE=InnoDB AUTO_INCREMENT=216 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `guwen_inbox_link`
